export default function FraudDetectionSystem() {
    // ... existing logic ...
  
    return (
      <div className="space-y-8">
        <div className="border-b border-gray-200 pb-6">
          <h2 className="text-2xl font-bold text-gray-800">Transaction Analysis</h2>
          <p className="text-gray-600">Enter details to assess fraud risk</p>
        </div>
  
        <form onSubmit={handleSubmit} className="space-y-6">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <FormField
              label="Transaction ID"
              name="transactionId"
              value={formData.transactionId}
              onChange={handleChange}
              required
            />
            <FormField
              label="Amount ($)"
              name="amount"
              type="number"
              value={formData.amount}
              onChange={handleChange}
              required
            />
            {/* Add more fields as needed */}
          </div>
  
          <button
            type="submit"
            disabled={loading}
            className={`w-full py-3 px-6 rounded-lg font-medium text-white ${
              loading ? 'bg-blue-400' : 'bg-blue-600 hover:bg-blue-700'
            } transition-colors shadow-md`}
          >
            {loading ? (
              <span className="flex items-center justify-center gap-2">
                <Spinner />
                Analyzing...
              </span>
            ) : (
              'Assess Fraud Risk'
            )}
          </button>
        </form>
  
        {result && (
          <div className="mt-8 space-y-6">
            <div className="border-b border-gray-200 pb-4">
              <h2 className="text-xl font-bold text-gray-800">Risk Assessment</h2>
            </div>
            
            <div className="grid md:grid-cols-2 gap-8">
              <ConfidenceChart confidence={result.confidence * 100} />
              
              <div className="space-y-4">
                <RiskBadge isFraud={result.is_fraud} />
                
                <div className="bg-gray-50 p-4 rounded-lg">
                  <h3 className="font-medium text-gray-700 mb-2">Transaction Details</h3>
                  <DetailRow label="ID" value={result.transaction_id} />
                  <DetailRow label="Amount" value={`$${result.amount}`} />
                </div>
                
                {result.reasons?.length > 0 && (
                  <div className="bg-red-50 p-4 rounded-lg border-l-4 border-red-500">
                    <h3 className="font-medium text-red-700 mb-2">Risk Indicators</h3>
                    <ul className="space-y-1">
                      {result.reasons.map((reason, i) => (
                        <li key={i} className="flex items-start">
                          <span className="text-red-500 mr-2">â€¢</span>
                          <span className="text-gray-700">{reason}</span>
                        </li>
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            </div>
            
            <ExportButton data={result} />
          </div>
        )}
      </div>
    );
  }
  
  // Helper Components
  const Spinner = () => (
    <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white"></div>
  );
  
  const RiskBadge = ({ isFraud }) => (
    <div className={`inline-flex items-center px-4 py-2 rounded-full text-sm font-medium ${
      isFraud ? 'bg-red-100 text-red-800' : 'bg-green-100 text-green-800'
    }`}>
      {isFraud ? 'High Risk Detected' : 'Low Risk Transaction'}
    </div>
  );
  
  const DetailRow = ({ label, value }) => (
    <div className="flex justify-between py-2 border-b border-gray-100 last:border-0">
      <span className="text-gray-500">{label}</span>
      <span className="font-medium">{value}</span>
    </div>
  );
  
  const FormField = ({ label, ...props }) => (
    <div>
      <label className="block text-sm font-medium text-gray-700 mb-1">{label}</label>
      <input
        className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-blue-500 focus:border-blue-500"
        {...props}
      />
    </div>
  );
